import React from 'react';
import './AsphaltRoofing.css';
import AsphaltRoofingImage1 from './Pictures/AsphaltRoofingImage1.png';
import ShakesRoofingImage1 from './Pictures/ShakesRoofingImage1.png'
function AsphaltRoofing() {
  return (
    <div className="roofing-container">
      <div className="asphalt-section">
        <div className="images-container-asphalt">
          <img src={AsphaltRoofingImage1} alt="Asphalt Shingle Roofing" className="roof-image" />
        </div>
        <div className="text-container-asphalt">
          <h1>Asphalt Shingle Roofing Installation</h1>
          <p>Asphalt shingles are one of the most popular roofing materials in NYC due to their affordability, versatility, and durability. Our team has installed countless asphalt shingle roofs over the years, using the latest techniques and materials to ensure that your new roof looks great and provides reliable protection for your home.</p>
        </div>
      </div>

      <div className="shakes-section">
        <div className="text-container-asphalt blue-bg">
          <h1>Shakes Roofing Installation In NYC</h1>
          <p>Shakes are another popular roofing material that provides a rustic, natural look for your home. Our team has extensive experience with shakes roof installation in NYC, and we can help you choose the right materials and design for your home.</p>
        </div>
        <div className="images-container">
          <img src={ShakesRoofingImage1} alt="Shakes Roofing" className="roof-image" />
        </div>
      </div>
    </div>
  );
}

export default AsphaltRoofing;
